    string s;
    cin >> s;
    int n = s.size();
    int result = 0;
    int sign = 1;
    int curr = 0;
    for (int i = 0; i < n; ++i) {
        if (s[i] == '+') {
            result += sign * curr;
            curr = 0;
            sign = 1;
        } else if (s[i] == '-') {
            result += sign * curr;
            curr = 0;
            sign = -1;
        } else if (s[i] == '*') {
            result += sign * curr;
            curr = 0;
            sign = 1;
        } else if (s[i] == '=') {
            result += sign * curr;
            curr = 0;
            sign = 1;
        } else {
            curr = curr * 10 + s[i] - '0';
        }
    }
    cout << result << endl;

    return 0;
}
